function convertirValor(valor) {
    // Asegurarse de que el valor est en el rango de 0 a 180
    valor = Math.max(0, Math.min(180, valor));

    // Calcular el valor correspondiente en el rango de 1 a 13
    if (valor === 0) {
        return 1;
    } else if (valor === 180) {
        return 13;
    } else {
        // Calcular el valor proporcional en el rango de 1 a 13
        return Math.round((valor - 1) / 180 * 12) + 1;
    }
}

